// HomePage.jsx
import React from 'react';
import Logo from '../components/Logo'; // Importez le composant Logo
import CopyrightText from '../components/CopyrightText'; // Importez le composant CopyrightText

function HomePage() {
  return (
    <div>
      <Logo />
      <div style={{ display: 'flex', justifyContent: 'center' }}>
        <div style={{ border: '1px solid black', padding: '20px', margin: '20px', textAlign: 'center' }}>
          <img src="icone1.png" alt="Icône 1" />
          <p>Texte pour l'icône 1</p>
        </div>
        <div style={{ border: '1px solid black', padding: '20px', margin: '20px', textAlign: 'center' }}>
          <img src="icone2.png" alt="Icône 2" />
          <p>Texte pour l'icône 2</p>
        </div>
        {/* Ajoutez plus de cadres d'icônes si nécessaire */}
      </div>
      <div style={{ textAlign: 'center', marginTop: '50px' }}>
        <CopyrightText />
      </div>
    </div>
  );
}

export default HomePage;
